const tailwindCssUrl =
  "https://cdn.jsdelivr.net/npm/tailwindcss@2.2/dist/tailwind.min.css";

State.init({
  theme: null,
});

const tailwindCss = fetch(tailwindCssUrl).body;

if (!tailwindCss) return "Can't load CSS 😔.";

if (!state.theme) {
  State.update({
    theme: styled.div`
    ${tailwindCss}`,
  });
}

const Theme = state.theme;
const card = (
  <div class="relative w-[200px] h-full">
    <div class="bg-white shadow-sm p-4 w-[200px] border-2 border-black text-black absolute z-1 rounded">
      Hello
    </div>
    <div class="bg-black w-full h-full p-4 absolute -z-1 top-1 left-1 rounded" />
  </div>
);

return <Theme>{card}</Theme>;
